    thing_info.set_owner(uid, new_owner)
    if thing_info.get_price_amount(uid) > 0:
        thing_info.set_price(uid, 0, '')
    __add_to_balance(new_owner)
    __subtract_from_balance(old_owner)


def __add_to_balance(holder: str):
    if __balances[holder] is None:
        __balances[holder] = 1
    else:
        __balances[holder] = __balances[holder] + 1


def __subtract_from_balance(holder: str):
    if __balances[holder] is None:
        __balances[holder] = 0
    else:
        __balances[holder] = __balances[holder] - 1

