__S = Hash(default_value='', contract='con_pixel_frames_info', name='S')


@__export('con_pixel_frames_info')
def add_thing(thing_string: str, name: str, description: str, meta: dict,
    creator: str):
    __enforce_thing_standards(thing_string, name, description, meta)
    uid = hashlib.sha256(thing_string)
    assert not __S[uid], thing_string + ' already exists'
    names_uid = hashlib.sha256(name.lower().replace(' ', ''))
    assert not __S['names', names_uid
        ], 'A form of this name already belongs to ' + __S['names', names_uid]
    __S['names', names_uid] = uid
    __custom_string_validations(thing_string, meta['num_of_frames'])
    __S[uid] = ['thing', 'type', 'name', 'description', 'owner', 'creator',
        'likes', 'price:amount', 'price:hold', 'meta_items']
    __S[uid, 'thing'] = thing_string
    __S[uid, 'type'] = 'text/plain'
    __S[uid, 'name'] = name
    __S[uid, 'description'] = description
    __S[uid, 'owner'] = creator
    __S[uid, 'creator'] = creator
    __S[uid, 'created'] = now
    __S[uid, 'likes'] = 0
    __S[uid, 'price', 'amount'] = 0
    __S[uid, 'meta_items'] = ['speed', 'num_of_frames', 'royalty_percent']
    __S[uid, 'meta', 'speed'] = meta['speed']
    __S[uid, 'meta', 'num_of_frames'] = meta['num_of_frames']
    __S[uid, 'meta', 'royalty_percent'] = meta['royalty_percent']
    return uid


def __enforce_thing_standards(thing_string: str, name: str, description:
    str, meta: dict):
    assert len(thing_string) > 0, 'Thing string cannot be empty.'
    assert len(name) > 0, 'No Name provided.'
    assert len(name) <= 25, 'Name too long (25 chars max).'
    assert len(description) > 0, 'No description provided.'
    assert len(description) <= 128, 'Description too long (128 chars max).'
    __custom_meta_validations(meta)


def __custom_string_validations(thing_string: str, num_of_frames: int):
    assert num_of_frames >= 1 and num_of_frames <= 8, 'num_of_frames value ' + str(
        num_of_frames) + ' is out of range (1-4).'
    assert len(thing_string
        ) % num_of_frames == 0, 'num_of_frames value is invalid.'
    assert len(thing_string
        ) / num_of_frames == 625, 'Frames Data is Invalid, must be 625 pixels/frame.'
    __assertPixelValues(thing_string)


def __assertPixelValues(thing_string):
    for pixel in thing_string:
        assert (ord(pixel) >= 65 and ord(pixel) <= 122) and ord(pixel
            ) != 92, 'Frames Data contains invalid pixel {}.'.format(pixel)


def __custom_meta_validations(meta):
    assert 'speed' in meta, "Missing meta value 'speed' (int)."
    assert isinstance(meta['speed'], int), 'Speed value is not an integer.'
    assert meta['speed'] >= 100 and meta['speed'
        ] <= 2000, 'Speed value ' + str(meta['speed']
        ) + ' is out of range (100ms-2000ms).'
    assert 'num_of_frames' in meta, "Missing meta value 'num_of_frames' (int)."
    assert isinstance(meta['num_of_frames'], int
        ), 'num_of_frames value is not an integer.'
    assert 'royalty_percent' in meta, "Missing meta value 'royalty_percent' (int)."
    assert isinstance(meta['royalty_percent'], int
        ), 'royalty_percent value is not an integer.'
    assert meta['royalty_percent'] >= 0 and meta['royalty_percent'
        ] <= 100, 'royalty_percent value ' + str(meta['royalty_percent']
        ) + ' is out of range (0-100).'


